    let atacante:number = 0;
    if (this.luchador.getAtributos().velocidad >= this.secondLuchador.getAtributos().velocidad) {
      atacante = 1;
    } else {
      if (this.luchador.getAtributos().velocidad < this.secondLuchador.getAtributos().velocidad) {
        atacante = 2;
      }
    }
    return atacante;
  }
  /**
